import LinkedinLogo from "../assets/footer/linkedin.svg";
import TiktokLogo from "../assets/footer/tiktok.svg";
import YoutubeLogo from "../assets/footer/youtube.svg";

const Footer = () => {
  return (
    <footer className="flex justify-between w-full bg-gray-800 text-white px-4 py-6">
      {/* Left section */}
      <div className="flex flex-col justify-between w-2/5 gap-24">
        <div className="flex flex-col gap-4">
          <img src={Logo} alt="Logo" className="w-8 h-8" />
          <img src=''></img>
          <p className="text-left font-inter text-xs text-neutral-400 ">Effortlessly turn your ideas into a fully functional, responsive, no-code SaaS website.</p>
        </div>
        <div className="flex flex-row gap-3">
          {/* <img src={XLogo} alt="X" width={} height={30} /> */}
