          <img src={LinkedinLogo} alt="LinkedIn" width={30} height={30} />
          <img src={TiktokLogo} alt="TikTok" width={30} height={30} />
          <img src={YoutubeLogo} alt="YouTube" width={30} height={30} />
        </div>
      </div>

      {/* Right section */}
      <div>
        vnvwrv
      </div>
    </footer>
  );
};

export default Footer;
